import './Home.css';

export default function Home() {
  return (
    <div className = 'Home'>
        <div className='Carrousel'>
           <img className='contorno' src='banner1.jpg' width='800px' height='350px'></img>
        </div>
        <div className='img'>
           <img className='contorno' src='Ellos.jpg' width='353px' height='300px'></img>
        </div>
        <div className='img-2'>
           <img className='contorno' src='izquierda.jpg' width='353px' height='300px'></img>           
        </div>
        {/* <div  className='img-3'>
           <img className='contorno' src='centro.jpg' width='353px' height='300px'></img>          
        </div>
        <div className='img-4'>
           <img className='contorno' src='derecha.jpg' width='353px' height='300px'></img>
        </div> */}
    </div>
  );
}
